import React, { useCallback, useState } from 'react'
import Todo from './Todo';

const Test = () => {
    const [data,setData]=useState(0);
    const [list, setList]=useState([]);

    const incrementVal=()=>{
        setData(()=>{
            return data+1;
        })
    }

    const addTodo = useCallback(()=>{
        setList((preVal)=>[...preVal,'new entry'])

    },[list])


  return (
    <React.Fragment>
        <Todo list={list} addTodo={addTodo}/>
        {data}
        <button onClick={incrementVal}>click here</button>
    </React.Fragment>
  )
}

export default Test
